     Photoshop 7 Training CD : PhotoshopCAFE LIVE

     The CD features over 80 minutes of live video. There are no lame fillers,
     just fast-paced back to back Photoshop 7 Tutorials and tips. In all there
     are 15 projects including a full 20 minute Background Super Tutorial. 
     Every tutorial has that &quot;little extra&quot; that Colin is known for, where he
     takes you step by step through every move in PLAIN ENGLISH and then throws
     in some tweaks to really make the images stand out from the rest.This CD 
     will change the way you use Photoshop.

     http://www.dreamweavercafe.com/photoshopCD/cafe-live.htm

     Have Fun!

     And as always...if u like it, buy it....


